const int angleOffs[4] = {0, -(2 * FINE_ANGLE90 - 1), - 2 * FINE_ANGLE90 , -(4 * FINE_ANGLE90 - 1)};

float sin_t(float angle)
{
    // first, get the index number.
    int angleIndex = (int) (angle * (float) ((FINE_ANGLES / (2 * M_PI)))) & (FINE_ANGLES - 1);
    unsigned int index = angleIndex / (FINE_ANGLE90);
    angleIndex += angleOffs[index];
    int signAngle = (index & 1) ? -1 : 1;
    int signSine = (index & 2) ? -1 : 1;
    return signSine * fine_sintable[signAngle * angleIndex];

}
float cos_t(float angle)
{
    return sin_t(angle + M_PI / 2);
}
float tan_t(float angle)    // implemented as division (And not tabulated) as tan_t is called few times per frame.
{
    float c = cos_t(angle);
    if (c == 0)
        return sin_t(angle) > 0 ? TAB_INFINITE : -TAB_INFINITE;
    else
        return sin_t(angle) / c;
}
